import { DELETE_USER_CRM, GET_UPDATE_USER_CRM, GET_USER_CRM } from "./valiable.reducer";

export const getUpdateDataUser_Action = (datas) => {
  return {
    type: GET_UPDATE_USER_CRM,
    datas,
  };
};


export const getDataUser_Action = (datas) => {
  return {
    type: GET_USER_CRM,
    datas,
  };
};

export const deleteDataUser_Action = (datas) => {
  return {
    type: DELETE_USER_CRM,
    datas,
  };
};
